const FaceRecognition = () =>{
  return (
    <div className='center'>
      <img src='https://images.unsplash.com/photo-1438761681033-6461ffad8d80?ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8cGVyc29ufGVufDB8fDB8fA%3D%3D&ixlib=rb-1.2.1&w=1000&q=80' alt='face detection' />
    </div>
  );
}

export default FaceRecognition;
